window.bookSummaryJSON = "<p>I have few friends and fewer allies. What I do have on the island of Everland is a lot of people who want me gone. So when the Crocodile and Captain Hook reappear in my life, I am in no mood. And worse, theyâ€™re unknowingly endangering themselves by asking for me by a name I long considered dead. Now, not only do I have to save myself, I have to save the two men who I swore I would murder with my bare hands if I ever set eyes on them again considering they abandoned me. </p> <p>Unfortunately for me, Roc and Hook have other plans, and when I find myself caught between them, I have to make a decision: risk my heart or risk my life?</p> <p>Devourer of Men is a dark MMF romantasy fairytale retelling. Characters have been aged up for this darker, grittier version. For a full list of content warnings, please visit the author's website.</p>"; 
